class IconEngine : public QIconEngine {
	public:
		IconEngine(QChar ch, const QColor &c, const QFont &f)
		: _ch(ch), _chOff(ch), _color(c), _colorOff(c), _font(f) {}

		IconEngine(QChar ch, QChar chOff, const QColor &c, const QColor &cOff, const QFont &f)
		: _ch(ch), _chOff(chOff), _color(c), _colorOff(cOff), _font(f) {}

	public:
		QIconEngine *clone() const override {
			return new IconEngine(_ch, _chOff, _color, _colorOff, _font);
		}

		void paint(QPainter *painter, const QRect &rect, QIcon::Mode mode, QIcon::State state) override {
			Q_UNUSED(state);

			painter->save();

			const QColor &color = ( state == QIcon::On ) ? _color : _colorOff;
			if ( color.isValid() )
				painter->setPen(color);
			else if ( mode == QIcon::Disabled )
				painter->setPen(qApp->palette().color(QPalette::Disabled, QPalette::Text));
			else if ( mode == QIcon::Normal )
				painter->setPen(qApp->palette().color(QPalette::Normal, QPalette::Text));
			else if ( mode == QIcon::Active )
				painter->setPen(qApp->palette().color(QPalette::Active, QPalette::Text));
			else if ( mode == QIcon::Selected )
				painter->setPen(qApp->palette().color(QPalette::Active, QPalette::Text));

			const QChar &ch = ( state == QIcon::On ) ? _ch : _chOff;

			if ( rect.width() * 100 / rect.height() < 125 )
				_font.setPixelSize(rect.width() * 100 / 125);
			else
				_font.setPixelSize(rect.height());

			painter->setFont(_font);
			painter->drawText(rect, Qt::AlignCenter, ch);
			painter->restore();
		}

		QPixmap pixmap(const QSize& size, QIcon::Mode mode, QIcon::State state) override {
			QPixmap pm(size);
			pm.fill( Qt::transparent );

			QPainter p(&pm);
			paint(&p, QRect(QPoint(0,0),size), mode, state);

			return pm;
		}

	private:
		QChar  _ch;
		QChar  _chOff;
		QColor _color;
		QColor _colorOff;
		QFont  _font;
};


